INSERT INTO `sys_log` VALUES ('1014', '1', '2023-04-11 13:12:34.807000', null, '1', '2023-04-11 13:12:34.807000', null, 'Windows-Chrome-109.0.0.0', '北海市', 'cn.xueden.system.controller.UserController.getList', null, 'GET', '电信', '[{\"searchValue\":\"\"},{\"pageIndex\":1,\"pageSize\":10}]', '广西', '180.142.66.238', 'http://vueboot.xueden.cn/user', '{\"headers\":{},\"body\":{\"content\":[{\"id\":15,\"username\":\"111\",\"password\":\"123456\",\"realname\":\"111\",\"sex\":\"男\",\"status\":1,\"email\":\"111\",\"sysRole\":{\"id\":1,\"name\":\"系统管理员\",\"code\":\"ROLE_ADMIN\",\"createTime\":1670497923000,\"createBy\":1,\"updateTime\":1670497919000,\"updateBy\":1,\"remarks\":\"系统管理员\"},\"createTime\":1677988962648,\"createBy\":1,\"updateTime\":1677989774675,\"updateBy\":1,\"remarks\":\"111\"},{\"id\":14,\"username\":\"wensiyue\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"文思月\",\"sex\":\"男\",\"status\":1,\"email\":\"wensiyue@qq.com\",\"sysRole\":{\"id\":2,\"name\":\"普通用户\",\"code\":\"ROLE_USER\",\"createTime\":1670497935000,\"createBy\":1,\"updateTime\":1670497950000,\"updateBy\":1,\"remarks\":\"普通用户\"},\"createTime\":1670269720648,\"createBy\":1,\"updateTime\":1670269720648,\"updateBy\":1,\"remarks\":\"韩立旧识文樯之女。妙音门女修，外出执行危险任务，父女被韩立所救。韩立助其脱离妙音门文思月打算以身相许，奈何韩立不解风情，将她安置在一个荒岛上自行离去。\"},{\"id\":13,\"username\":\"hanyunzhi\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"菡云芝\",\"sex\":\"女\",\"status\":1,\"email\":\"hanyunzhi@qq.com\",\"sysRole\":{\"id\":2,\"name\":\"普通用户\",\"code\":\"ROLE_USER\",\"createTime\":1670497935000,\"createBy\":1,\"updateTime\":1670497950000,\"updateBy\":1,\"remarks\":\"普通用户\"},\"createTime\":1670269660257,\"createBy\":1,\"updateTime\":1670269660258,\"updateBy\":1,\"remarks\":\"韩立旧识。御灵宗女修，亲切可人，早年曾在太南小会上卖给韩立金竺符笔，多年后和柳眉等奉命追查至木灵婴下落，被韩立发现，韩立追上她时，发现是多年前旧识只将其打晕。\"},{\"id\":12,\"username\":\"dongxuaner\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"董萱儿\",\"sex\":\"女\",\"status\":1,\"email\":\"dongxuaner@qq.com\",\"sysRole\":{\"id\":2,\"name\":\"普通用户\",\"code\":\"ROLE_USER\",\"createTime\":1670497935000,\"createBy\":1,\"updateTime\":1670497950000,\"updateBy\":1,\"remarks\":\"普通用户\"},\"createTime\":1670269622119,\"createBy\":1,\"updateTime\":1670269622119,\"updateBy\":1,\"remarks\":\"韩立旧识。为人高傲，为了驻颜修炼化春决，喜欢男人为她争风吃醋，其师傅撮合她和韩立双修，两人相互不对眼，红拂派其和韩立一起参加燕家夺宝大会。\"},{\"id\":11,\"username\":\"chenqiaoqian\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"陈巧倩\",\"sex\":\"女\",\"status\":1,\"email\":\"chenqiaoqian@qq.com\",\"sysRole\":{\"id\":2,\"name\":\"普通用户\",\"code\":\"ROLE_USER\",\"createTime\":1670497935000,\"createBy\":1,\"updateTime\":1670497950000,\"updateBy\":1,\"remarks\":\"普通用户\"},\"createTime\":1670269579410,\"createBy\":1,\"updateTime\":1670269579410,\"updateBy\":1,\"remarks\":\"韩立黄枫谷师姐。经过一些事与非后，爱上韩立，曾经向韩立告白，被一心求大道的韩立拒绝，为等韩立未婚不嫁，道消身死。后韩立在灵界碰到与巧倩长相极其相似之人，讶然不已。\"},{\"id\":10,\"username\":\"nangongwan\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"南宫婉\",\"sex\":\"男\",\"status\":1,\"email\":\"333@qq.com\",\"sysRole\":{\"id\":2,\"name\":\"普通用户\",\"code\":\"ROLE_USER\",\"createTime\":1670497935000,\"createBy\":1,\"updateTime\":1670497950000,\"updateBy\":1,\"remarks\":\"普通用户\"},\"createTime\":1670260436953,\"createBy\":1,\"updateTime\":1670260436953,\"updateBy\":1,\"remarks\":\"韩立道侣。掩月宗女修，本命法宝朱雀环，修炼素女轮回功 。\"},{\"id\":7,\"username\":\"yuanyao\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"元瑶\",\"sex\":\"女\",\"status\":1,\"email\":\"33@qq.com\",\"sysRole\":{\"id\":2,\"name\":\"普通用户\",\"code\":\"ROLE_USER\",\"createTime\":1670497935000,\"createBy\":1,\"updateTime\":1670497950000,\"updateBy\":1,\"remarks\":\"普通用户\"},\"createTime\":1670218734366,\"createBy\":1,\"updateTime\":1670218734366,\"updateBy\":1,\"remarks\":\"韩立红颜知己。魁星岛附近的修仙小门派女修，对师姐妍丽重情重义，为已成鬼魂的师姐不死重生付出极大代价，与师姐修炼阴阳轮回诀被未知通道吸入灵界，后被姜老怪/青元子收为徒。韩立于其帮衬良多，对韩立情素暗生。\"},{\"id\":6,\"username\":\"lifeiyu\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"厉飞雨\",\"