INSERT INTO `sys_log` VALUES ('1146', '1', '2023-04-11 23:53:00.966000', null, '1', '2023-04-11 23:53:00.966000', null, 'Mac-Chrome-111.0.0.0', '深圳市', 'cn.xueden.system.controller.UserController.getList', null, 'GET', '电信', '[{\"searchValue\":\"\"},{\"pageIndex\":1,\"pageSize\":10}]', '广东省', '119.123.135.35', 'http://vueboot.xueden.cn/user', '{\"headers\":{},\"body\":{\"content\":[{\"id\":15,\"username\":\"111\",\"password\":\"123456\",\"realname\":\"111\",\"sex\":\"男\",\"status\":1,\"email\":\"111\",\"sysRole\":{\"id\":1,\"name\":\"系统管理员\",\"code\":\"ROLE_ADMIN\",\"createTime\":1670497923000,\"createBy\":1,\"updateTime\":1670497919000,\"updateBy\":1,\"remarks\":\"系统管理员\"},\"createTime\":1677988962648,\"createBy\":1,\"updateTime\":1677989774675,\"updateBy\":1,\"remarks\":\"111\"},{\"id\":14,\"username\":\"wensiyue\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"文思月\",\"sex\":\"男\",\"status\":1,\"email\":\"wensiyue@qq.com\",\"sysRole\":{\"id\":2,\"name\":\"普通用户\",\"code\":\"ROLE_USER\",\"createTime\":1670497935000,\"createBy\":1,\"updateTime\":1670497950000,\"updateBy\":1,\"remarks\":\"普通用户\"},\"createTime\":1670269720648,\"createBy\":1,\"updateTime\":1670269720648,\"updateBy\":1,\"remarks\":\"韩立旧识文樯之女。妙音门女修，外出执行危险任务，父女被韩立所救。韩立助其脱离妙音门文思月打算以身相许，奈何韩立不解风情，将她安置在一个荒岛上自行离去。\"},{\"id\":13,\"username\":\"hanyunzhi\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"菡云芝\",\"sex\":\"女\",\"status\":1,\"email\":\"hanyunzhi@qq.com\",\"sysRole\":{\"id\":2,\"name\":\"普通用户\",\"code\":\"ROLE_USER\",\"createTime\":1670497935000,\"createBy\":1,\"updateTime\":1670497950000,\"updateBy\":1,\"remarks\":\"普通用户\"},\"createTime\":1670269660257,\"createBy\":1,\"updateTime\":1670269660258,\"updateBy\":1,\"remarks\":\"韩立旧识。御灵宗女修，亲切可人，早年曾在太南小会上卖给韩立金竺符笔，多年后和柳眉等奉命追查至木灵婴下落，被韩立发现，韩立追上她时，发现是多年前旧识只将其打晕。\"},{\"id\":12,\"username\":\"dongxuaner\",\"password\":\"E10ADC3949BA59ABBE56E057F20F883E\",\"realname\":\"董萱儿\",\"sex\":\"女\",\"status\":1,\"email\":\"dongxuaner@qq.co